var tipuesearch = {"pages":[{"tags":"misc","url":"./pages/about/","title":"About","text":"2016Fall 修課成員網誌"},{"tags":"Misc","url":"./20161007-w04.html","title":"2016/10/07 W04","text":"coming soon"},{"tags":"Misc","url":"./20160930-w03.html","title":"2016/09/30 W03","text":"第三週上課進度 如何使自己的課程倉儲及個人網頁能展示出基礎架構 讓自己的個人倉儲有基礎架構 1.先git clone自己的倉儲 2.至班級倉儲git clone班級倉儲 3.將課程倉儲的基礎架構複製到個人倉儲 4.將個人倉儲推送至遠端 讓自己的個人網頁有基礎架構 1.至scrum-3的倉儲裡的index複製程式碼 2.將程式碼複製到個人網頁的index 心得：這禮拜的作業跟上學期所教的內容差不多，因此在進度上還沒有落後太多。 第三週影片 2016 Fallcadpb W3 from 40423245 on Vimeo ."},{"tags":"Misc","url":"./20160923-w02.html","title":"2016/09/23 W02","text":"第二週上課進度 須學會如何利用ShareX錄製影片 1.先至ShareX 官網 下載軟體 2.至軟體的Task settings中的Screen recorder裡的Screen recording設定錄影對象及錄音方式 3.製軟體的Application settings中的path設定存檔內容 4.按下Shift+Prt Scrn即可選擇錄影框框 5.再按下Shift+Prt Scrn即可停止錄影 心得：ShareX是個不錯的軟體，它可以選擇要錄影的部分，重要的是它有開放原始碼，能夠讓我們知道他是如何寫的。 第二週影片 2016 Fallcadpb W2 from 40423245 on Vimeo ."},{"tags":"Misc","url":"./20160916-w01.html","title":"2016/09/16 W01","text":"第一週上課進度 1.登入 github, fork(https://github.com/mdecourse/2016fallcadp) 2.在自己的帳號下建立 2016fallcadp_hw 倉儲, 將 default branch 設為 gh-pages 3.在自己的帳號下建立 帳號.github.io 倉儲, 並在其下建立 index.html 即可用 https://帳號.github.io 連結 index.html 4.自選組員, 先確定各組組長學號, 將會設為[課程倉儲] (https://github.com/mdecourse/2016fallcadp) 倉儲的協同者, 專門負責協助管理此倉儲, 並處理組員對此倉儲的 pull requests 心得：第一週上課老師大概講解了一下這學期要做的事，這學期我們會有比較多分組上的作業，因此組員間的配合相當重要，第一週也因為中秋連假而調課。 第一週影片 2016 Fallcadpb W1 from 40423245 on Vimeo ."}]};